import React, { useState } from 'react';
import {
    Container,
    FormContainer,
    Title,
    InputLabel,
    Input,
} from '../styles/LoginStyles';
import axios from 'axios';

export default function Login() {
    const [Email, setEmail] = useState<String>('');
    const [Name, setName] = useState<String>('');
    const handleClick = (event: React.MouseEvent<HTMLButtonElement>) => {
        event.preventDefault(); // Prevents the default behavior of the button click
        // Your custom logic here

        axios.post('https://frontend-take-home-service.fetch.com/auth/login', {
            name: Name,
            email: Email
          })
          .then(function (response) {
            console.log(response);
          })
          .catch(function (error) {
            console.log(error);
          });
    };

    return (
        <Container>
            <FormContainer>
                <Title>Shelter dogs Login</Title>
                <InputComponent
                    name={'name'}
                    placeholder='Write your name'
                    type='text'
                    callbackFunction={setName}
                />
                <InputComponent
                    name={'Email'}
                    placeholder='Write your email'
                    type='email'
                    callbackFunction={setEmail}
                />

                <button onClick={(e) => {handleClick(e)}}>save</button>
                {/* <InputComponent name='correo' /> */}
            </FormContainer>
        </Container>
    );
}

function InputComponent({
    name,
    placeholder,
    type,
    callbackFunction,
}: {
    name: string;
    placeholder: string;
    type: 'email' | 'text' | 'number';
    callbackFunction: (newValue: string) => void;
}) {
    return (
        <>
            <InputLabel>{name}</InputLabel>
            <Input
                type={type}
                placeholder={placeholder}
                onChange={(e) => {
                    callbackFunction(e.target.value);
                }}
            />
        </>
    );
}
